import React from "react";
import styled from "styled-components";
import { SPACING } from "./Global Styles/styles";
import SearchBar from "./SearchBar";
import Tag from "./Tag";
import Card from "./Card";
import { COLORS } from "./Global Styles/styles";

const MainArea = styled.main`
    display: flex;
    padding: ${SPACING.large}, 126px, 0px, 126px;
    background-color: wheat;
`;

const Main = () => {
    return(
        <MainArea>
            <SearchBar />
            <Tag type="Ice" color={ COLORS.typeIce }/>
            <Card />
        </MainArea>
    );
}

export default Main;
